import react from 'react'

import projecttabsStyles from './styles/projecttabs.module.scss'

class ProjectTabs extends react.Component {

    render() {
        return (
            <div className={projecttabsStyles.projectsContainer}>
                {this.props.children.map((child, idx) => {
                    return (
                        // passing child state to parent
                        <a key={idx} href="#" onClick={() => this.props.onChange(child.key)}
                            className={this.props.active === child.key ? tabsStyles.active : null}>
                            {child}
                        </a>
                    )
                })
                }
            </ div >
        )
    }
}

export default ProjectTabs;
